import React, { useEffect, useState } from "react"
import { Nav, Navbar, NavDropdown, Form, FormControl, Button } from 'react-bootstrap';


function NavBar() {

    const [toggleClick, setToggleClick] = useState(false)
    console.log("initial", toggleClick)
    var introBgImg = document.getElementById("intro-bg-img")


    if (toggleClick === true) {
        console.log("here is in false")
        introBgImg.remove();
    }
    else {
        console.log(toggleClick)
        Document.getElementById("intro-box").append(introBgImg)
    }




    return (
        <Navbar bg="none" expand="lg">
            <Navbar.Brand href="#home"><img id="logo-header" src="images/logo.svg" alt="logo" /></Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" id="nav-toggle" onClick={() => { setToggleClick(!toggleClick) }} />
            <Navbar.Collapse id="basic-navbar-nav" className="navbar-item-clp" bg="dark">
                <Nav className="mr-auto nav-items">
                    <Nav.Link href="#home" id="feature" className="nav-text">Feature</Nav.Link>
                    <Nav.Link href="#link" id="pricing" className="nav-text">Pricing</Nav.Link>
                    <Nav.Link href="#link" id="resources" className="nav-text">Resources</Nav.Link>

                </Nav>
                <hr />
                <Nav className="nav-items">
                    <Nav.Link href="#link" id="login" className="nav-text">Login</Nav.Link>
                    <Nav.Link href="#link" id="sign-up" className="nav-text">Sign Up</Nav.Link>
                </Nav>
            </Navbar.Collapse>
        </Navbar>
    )
}

export default NavBar;
